Het is het jaar 140, 20 jaar eerder marcheerden het Negende Legioen van Rome, onder het bevel van Flavius Aquila, naar het noorden. Het keerde nooit meer terug. Flavius's zoon Marcus is vastbesloten om de geschonden reputatie van zijn vader te herstellen. Alleen begeleid door zijn slaaf Esca rijdt Marcus uit naar het noorden. Tijdens de reis beseft Marcus dat de verdwijning van zijn vader mogelijk gekoppeld is aan de mysterieuze identiteit van Esca. Het mysterie wordt steeds groter wanneer ze tegenover de krijgers van de angstaanjagende Seal Prins komen te staan.

English:
In Roman-ruled Britain, a young Roman soldier endeavors to honor his father's memory by finding his lost legion's golden emblem.

